import { put, takeEvery } from "redux-saga/effects";
import { delay } from "redux-saga";


export function* doRegistration(): IterableIterator<any>{
yield takeEvery(`@@login/DO_LOGIN`, function*(){
    yield  delay, '8';
    return '3';
    })
}
